import React from 'react';

import './Toolbar.css';

const toolbar = props => (
    <header className="toolbar">
        <nav className="toolbar_navigation">
            <div> </div>
            <div className="toolbar_logo">THE LOGO </div>
            <div className="toolbar_navigation_styling">
                <ul>
                    <li>Products</li>
                    <li>Users</li>
                </ul>
            </div>
        </nav>
    </header>
);

export default toolbar;
